import { Task } from "../Components/Task/TaskModel";

export interface ISelectorOption{
    key:string;
    value:string;
    label:string;
};

export interface ITaskFilter{
    func:(task:Task)=>Task | boolean;
    name:string
}

export type Filter<T> ={
    All:T,
    Completed:T,
    NotCompleted:T

    [name:string]:T
}

export type TaskPriorityProps = {
    Low:string;
    Medium:string;
    High:string;

    [name:string]:string
}
